import React from 'react';
import Header from './Components/Header';
import Home from './Views/Home';
import AdvanceSearch from './Views/AdvanceSearch';
import Favorites from './Views/Favorites';
import PromoDiscount from './Views/PromoDiscount';
import Setting from './Views/Setting';
import {BrowserRouter as Router, Switch, Route, Link} from "react-router-dom";

function App() {
  return (
    <div>
      <Router>
        <Header />

        <Switch>
            <Route exact path = "/"><Hone /></Route>
            <Route exact path = "/advancesearch"><h1 className = "font-bold text-2xl text-center">Search page</h1> </Route>
            <Route exact path = "/promodiscount"><h1 className = "font-bold text-2xl text-center">Promo and discount page</h1> </Route>
            <Route exact path = "/setting"><h1 className = "font-bold text-2xl text-center">Setting page</h1> </Route>
        </Switch>
      </Router>
    </div>
  );
}

export default App;
